import './App.css';
import { useEffect, useState } from 'react';

function App() {

  const [todos, setTodos] = useState([]);

  useEffect(() => {
    // fetch returns a promise
    fetch('https://dummyjson.com/todos/user/5')
      .then((res) => res.json())
      .then((data) => setTodos(data.todos))
  }, [])

  return (
    <section>
      <header>
        <h1>Todos</h1>
      </header>
      <main>
        <ul>
          {todos.map((item) => {
            return <li key={item.id}> {item.todo} </li>
          })}
        </ul>
      </main>
    </section>
  );
}

export default App;
